import React from 'react';
import styles from './ExclamationError.module.css';

const ExclamationError = () => {
  console.log('Hello World');

  return (
    <span>
      <span
          className={styles.exclamationError}>
        !
      </span>
    </span>
  );
};

export default ExclamationError;
